import React from 'react';

// CSS
import classes from './AccountButton.module.css';

// Component
const AccountButton = () => (
    <div className={classes.AccountButtonBackground}>
        <div className={classes.part}></div>
        <button className={classes.AccountButton}> Tvoj nalog <i className="fas fa-user"></i></button>
    </div>
);

// Export
export default AccountButton;
